import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {Provider} from "mobx-react/src/Provider";
import {playBarStore} from "./stores/playBarStore";


ReactDOM.render(
    <Provider store={playBarStore}>
        <App />
    </Provider>
    ,document.getElementById('root'));
